import React, { useEffect, useState } from "react";
import { Card, Container, Col, Row } from 'react-bootstrap';

function HomeFeed() {
    const profilesUrl = "http://localhost:8000/api/profiles/"
    const [profiles, setProfiles] = useState([]);

    const fetchProfiles = async () => {
        const response = await fetch(profilesUrl);
        const json = await response.json();
        setProfiles(json)
    }



    const postUrl = "http://localhost:8000/api/posts/"
    const [posts, setPosts] = useState([]);

    const fetchPosts = async () => {
        const response = await fetch(postUrl);
        const json = await response.json();
        setPosts(json)
    }

    useEffect(() => {
        fetchProfiles()
        fetchPosts()
    }, []);


    let profileFeed = posts.map((item, index) => {
        return(
            <Col lg={3}>
                <Card style={{ width: "15rem", margin: "0, auto"}}>

                </Card>
            </Col>
        )
    })

    return(

        <div className="testerFeed">
            <Row>
                <img src={profileFeed} alt="profile pics" />
            </Row>
        </div>

        );
}

export default HomeFeed;
